@Zilma De souza Esse argumento é tão falho que chega a ser engraçado.

É o mesmo que dizer que como a pessoa que foi internada depois de um acidente de carro tem mais chances de morrer do que a que não sofreu ferimentos graves e voltou pra casa, a pessoa não deveria ir pro hospital depois de um acidente de carro por que isso irá aumentar as chances dela morrer.
As pessoas que foram entubadas, foram entubadas justamente por que estavam em situação crítica, se estivessem em condições de "se tratar em casa" não estariam internadas e nem entubadas

